const holidays = {
	'uuele aastale eelnev päev': 'rockets',
	uusaasta: 'fireworks',
	kevadpüha: 'flowers',
	jaanipäev: 'campfires',
	emakeelepäev: 'pi_abc',
	jõululaupäev: 'presents',
	'esimene jõulupüha': 'presents',
	'teine jõulupüha': 'presents',
	emadepäev: 'flowers',
	isadepäev: 'bowties',
	hingedepäev: 'candles',
	'iseseisvuspäev, eesti vabariigi aastapäev': 'flag',
	'suur reede': 'crosses',
	'12-20': 'snow', // Around Christmas
	'12-21': 'snow', // Around Christmas
	'12-22': 'snow', // Around Christmas
	'12-23': 'snow', // Around Christmas
	'12-27': 'snow', // Around Christmas
	'12-28': 'snow', // Around Christmas
	'12-29': 'snow', // Around Christmas
	'12-30': 'snow', // Around Christmas
	'12-05': 'bussiaeg', // Bussiaeg.ee's birhtday
	'10-31': 'ghosts', // Halloween
	'02-14': 'hearts' // Valentine's day
};

let banner = '';

update();
async function update() {
	const date = moment().format('YYYY-MM-DD');
	banner = banners[holidays[(JSON.parse((await got('https://riigipühad.ee/?output=json')).body).find((_holiday) => _holiday.date === date) || { title: '' }).title.toLowerCase() || moment().format('MM-DD')]] || null;
}

// Get banner for holiday or by type.
function getBanner(req, res) {
	res.header('Content-Type', 'image/svg+xml');
	res.send(banner || '<svg version="1.1" xmlns="http://www.w3.org/2000/svg" />');
}

module.exports.update = update;
module.exports = (fastify, opts, next) => {
	fastify.get('/banner', {
		preHandler: cache.middleware
	}, getBanner);
	
	next();
};
